import React, {useState, useEffect}from "react";
import axios from "axios";
const baseURL = "http://localhost:7000/doctorData/";

export default function App() {
  const [previous, setNew] = React.useState([{}]);

  React.useEffect(() => {
  axios.get(baseURL)
    .then((response) => {
      setNew(response.data);
    });
  }, []);


console.log(previous);
  if (!previous) return null;

  return (
    <div>
      <h1>Doctor Data to be render</h1>

      {previous.map((pre) => (
        <ul>
          <li>
            {" "}
            <img src={pre.image} alt="image"></img>
          </li>
          <li key={pre.id}>{pre.name}</li>
          <li key={pre.id}>{pre.age}</li>
          <li key={pre.id}>{pre.gender}</li>
          <li key={pre.id}>{pre.specialization}</li>
          <li key={pre.id}>{pre.experience}</li>
         
        </ul>
      ))}
    </div>
  );
}
